//data import
import data from "./data.js";

function App() {
  return (
    <div className="App">
      <Header />
      <main>
      <div>

      </div>
        {data.products.map((index, card) => {
          <ProductCard index={index} />;
        })}
        {/* <ProductCard /> */}

      </main>
      <Footer />
    </div>
  );
}

export default App;
